import { BrowserRouter, Routes, Route } from "react-router-dom";
import TabsExample from "./components/Navbar";

import rootx from "./pages/Rootx";

function App() {
  return (
    <div>
      <BrowserRouter>
        <TabsExample/>
        <Routes>
          <Route path="/" element={<rootx/>} />
          <Route path="/DocotorAppointmentsListx" element={<DocotorAppointmentsListx/>} />
          <Route path="/BookAppointmentx" element={<BookAppointmentx/>} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
